pragma solidity ^0.8.12;

contract Crowdfunding{

struct transaction{
             uint lid;
	     uint amount;
	     string purpose;
	     string description;
	     string filename;
	     string date_entry;
	     string need_date;
	     uint policyid;
	     string types;

  }

struct donation{
	     uint loginid;
	     uint policyid;
	     string addresss;
	     uint amounts;
	     string date;
	     string types;
}


transaction [] alltrans;

function addTransaction(uint lida,uint amounts,string memory purposea,string memory desc,string memory filenamea,string memory date_entrya,string memory need_datea,uint policyida,string memory typea) 
public{
	transaction memory e = transaction(lida,amounts,date_entrya,need_datea,purposea,desc,filenamea,policyida,typea);
	alltrans.push(e);
}

donation [] alldon;

function addDonation(uint loginidb,uint policyidb,string memory addressb,uint amountb,string memory dateb,string memory typea)
public{
	donation memory c=donation(loginidb,policyidb,addressb,amountb,dateb,typea);
	alldon.push(c);

} 


}
